import { State } from "../State";

export class SprintResultsState extends State {
  results;
  constructor(machine, results, onClose) {
    super(machine);
    this.results = results;
    this.onClose = onClose;
  }

  enter() {
    const close = this.results.getChildByName("close");
    this.results.setVisible(true);
  }

  exit() {
    this.results.setVisible(false);
  }
}
